    //     })
    // }, [])
    const deleteUser = () => {
        cognitoUser.deleteUser((err, result) => {
            if (err) throw err
            console.log('User deleted', result)
        })
    }
    return (
        <div>
            <button onClick={deleteUser}>Delete user</button>
        </div>
    )
}

export default Branch
